import mapContext from './../../context/mapContext'


const User = () => {

    const { state } = useContext(mapContext)

    return <div>
        <h2>Prenom:{state.user.Prenom} Nom:{state.user.Nom}</h2>
        <h3>Mail:{state.user.Mail}</h3>
    </div>
}

export default User;
